import React, { useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards, Pagination } from "swiper";
import "swiper/css/pagination";


function CatSwiper(props) {

    const answers = props.array2;

    //const [newAnswers, setNewAnswers] = useState[answers];

    //function handleChange(event) {
       // const 
   // }

    if (props.array1.length == 0) {
        return (


             <div className="no-cats-alert">
                 <div>Ups! Obecnie nie mamy kotów, które spełniałyby Twoje
                     potrzeby! :( Jeśli chcesz, możesz wrócić później - nowi podopieczni stale do nas przybywają! -
                     lub spróbować zmienić niektóre odpowiedzi. Czasem kot, który lubi inne koty,
                     może być również wspaniałym jedynakiem - a wiek często nie ma znaczenia ;).
                 </div>
                 <div>
                     <form>
                         <fieldset>
                             <div>
                                 <input type="radio" id="doeslikecats1" name="likes other cats" value="likescats" checked={answers[0] === "yes"}/>
                                 <label for="doeslikecats1">Lubi koty</label>
 
                                 <input type="radio" id="doeslikecats1" name="likes other cats" value="dislikescats" checked={answers[0] === "no"}/>
                                 <label for="doeslikecats1">Nie lubi kotów</label>
                             </div>
                         </fieldset>
                         <fieldset>
                             <div>
                                 <input type="radio" id="attitude1" name="likes cuddles" value="cuddly" checked={answers[1] === "yes"}/>
                                 <label for="attitude1">Miziak</label>
 
                                 <input type="radio" id="attitude2" name="likes cuddles" value="loner" checked={answers[1] === "no"}/>
                                 <label for="attitude2">Samotnik</label>
                             </div>
                         </fieldset>
                         <fieldset>
                             <div>
                                 <input type="radio" id="character1" name="is energetic" value="energetic" checked={answers[2] === "yes"}/>
                                 <label for="character1">Energiczny</label>
 
                                 <input type="radio" id="character2" name="is energetic" value="flegmatic" checked={answers[2] === "no"}/>
                                 <label for="character2">Spokojny</label>
                             </div>
                         </fieldset>
                         <fieldset>
                             <div>
                                 <input type="radio" id="isyoung1" name="is young" value="young" checked={answers[3] === "yes"}/>
                                 <label for="isyoung1">Młodszy</label>
 
                                 <input type="radio" id="isyoung2" name="is young" value="older" checked={answers[3] === "no"}/>
                                 <label for="isyoung2">Starszy</label>
                             </div>
                         </fieldset>
                         <fieldset>
                             <div>
                                 <input type="radio" id="doeslikedogs1" name="likes dogs" value="likesdogs" checked={answers[4] === "yes"}/>
                                 <label for="doeslikedogs1">Lubi psy</label>
 
                                 <input type="radio" id="doeslikedogs2" name="likes dogs" value="dislikesdogs" checked={answers[4] === "no"}/>
                                 <label for="doeslikedogs2">Nie lubi psów</label>
                             </div>
                         </fieldset>
                         <fieldset>
                             <div>
                                 <input type="radio" id="ishealthy1" name="is healthy" value="healthy" checked={answers[5] === "yes"}/>
                                 <label for="ishealthy1">Zdrowy</label>
 
                                 <input type="radio" id="ishealthy2" name="is healthy" value="ill" checked={answers[5] === "no"}/>
                                 <label for="ishealthy2">Chory</label>
                             </div>
                         </fieldset>
                         <div>
                             <button type="submit">Spróbuj szczęścia!</button>
                         </div>
                     </form>
                 </div>
             </div>
        )
    }

    else {
        return (
            <div>
                <Swiper
                    pagination={{
                        type: "progressbar"
                    }}
                    navigation={true}
                    effect={"cards"}
                    grabCursor={true}
                    modules={[EffectCards, Pagination]}
                    className="mySwiper"
                >

                    {props.array1.map((obj, index) => (
                        <SwiperSlide key={index}>
                            <div className="swiper-content">
                                <div className="cat-swiper-name">{obj.name}</div>
                                <div className="cat-swiper-img"><img src={obj.img}></img></div>
                                <div className="cat-swiper-url"><a href={obj.url}>Zobacz!</a></div>
                            </div>
                        </SwiperSlide>
                    ))}
                </Swiper>
            </div>
        );
    }
}

export default CatSwiper;
